import { useEffect } from "react";

function Home() {
    useEffect(()=>{
        const fetchdata = async ()=>
        {
            const data = await fetch('/users_recs');
            console.log("md data "+data);
        };
        
    });
    return (<div>its working</div>);
}
export default Home;
